import { Link } from "react-router-dom";

const NavBar = () => {
    return ( 

        <div>
  <Nav
    justified
    pills
  >
    <NavItem>
      <NavLink
        active
        href="#"
      >
        Link
      </NavLink>
    </NavItem>
    <NavItem>
      <NavLink href="#">
        Another Link
      </NavLink>
    </NavItem>
    <NavItem>
      <NavLink
        disabled
        href="#"
      >
        Disabled Link
      </NavLink>
    </NavItem>
  </Nav>
</div>


        // <nav className="nav-bar">
